        <div>
            <FormAutoComponent/>
            <br/>
            <FormUsuarioComponent/>
            <br/>
            <TableAutoComponent/>
            <br/>
            <TableUsuarioComponent/>
            <br/>
        </div>
        

    )
}
export default HomePage;
